import "./ExpenseItem.css";

function ExpenseItem() {
  const expenseDate = new Date(2022, 10, 5);
  const expenseTitle = "Car Insurance";
  const expenseAmount = 294.67;

  return (
    <div className="expenses_one">
      <div className="date">{expenseDate.toISOString()}</div>
      <div className="expenses_details">
        <h2 className="expenses_text">{expenseTitle}</h2>
        <div className="expenses_amount">${expenseAmount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
